package chapter7.video69;public class Video69 {    public static int sum(int a, int b) {        return a + b;    }    public static double sum(double a, double b) {        return a + b;    }    public static double sum(double a, double b, double c) {        return a + b - c;    }    public static void main(String[] args) {        System.out.println("Sum = " + sum(3, 5, 5));    }}